import './navbar.css';
import React from 'react';
import { BrowserRouter as Router, Link, Routes, Route } from 'react-router-dom';

import { ShoppingCart } from 'lucide-react';
import logo from '../Assets/logo.png'


const Navbar = () => {

  return (
   
<Routes>

      <div className="navbar">
          <img src ={logo} />
          <Route>  <Link to="/" className='item'>SHOP</Link></Route>
        <Link to="/mens" className='item'>MEN</Link>
        <Link to="/womens" className='item'>WOMEN</Link>
        <Link to="/kids" className='item'>KIDS</Link>
        <Link to="/login" className='item'>LOGIN IN</Link>
        <Link to="/cart" className='item'><ShoppingCart/></Link>
        </div>

</Routes>
   
  );
};

export default Navbar;
